abM:function(a){return P.aq(["FAQAnswer1",Z.ax("Coronaviruses are a large family of viruses that can cause disease in animals or humans.  In humans, several coronaviruses are known to cause respiratory infections ranging from the common cold to more serious illnesses such as Middle East Respiratory Syndrome (MERS) and Severe Acute Respiratory Syndrome (SARS). The most recently discovered coronavirus causes COVID-19 coronaviral disease."),"FAQAnswer2",Z.ax("COVID-19 is the most recently discovered infectious disease caused by the coronavirus. This new virus and this new disease were unknown before the outbreak began in Wuhan, China in December 2019."),"FAQAnswer3",Z.ax("The most common symptoms of COVID-19 are fever, fatigue and dry cough. Some patients may experience pain, nasal congestion, runny nose, sore throat or diarrhea. These symptoms are usually mild and begin gradually. Some people are infected but do not develop any symptoms and do not feel sick. Most people (about 80%) recover from the disease without needing special treatment. About 1 in 6 people who get COVID-19 become seriously ill and develop breathing difficulties. The elderly and those with underlying medical conditions such as high blood pressure, heart problems or diabetes are more likely to develop serious illness. People with fever, cough, and difficulty breathing should seek medical attention."),"FAQAnswer4",Z.ax("People can get COVID-19 from other people who have the virus. The disease can be spread from person to person by small droplets from the nose or mouth that are spread when a person with COVID-19 coughs or expires. These droplets land on objects and surfaces around the person. Other people then get COVID-19 by touching these objects or surfaces and then touching their eyes, nose or mouth. People can also get COVID-19 if they breathe in the droplets from a person with COVID-19 who is coughing or breathing out the droplets. This is why it is important to stay more than one metre away from a sick person. WHO is evaluating ongoing research on the modes of spread of COVID-19 and will continue to share updated results."),"FAQAnswer5",Z.ax("Studies to date suggest that the virus that causes COVID-19 is transmitted primarily through contact with respiratory droplets rather than through the air."),"FAQAnswer6",Z.ax("The disease is spread mainly by respiratory droplets expelled by a coughing person. The risk of catching COVID-19 from a person with no symptoms is very low. However, many people with COVID-19 have only mild symptoms. This is especially true in the early stages of the disease. It is therefore possible to get COVID-19 from a person who, for example, has only a mild cough and does not feel sick.  WHO is evaluating ongoing research on the transmission period of COVID-19 and will continue to share updated results."),"FAQAnswer7",Z.ax("The risk of contracting COVID-19 from the stool of an infected person appears to be low. Although initial investigations suggest that the virus may be present in feces in some cases, spread through this route is not a major feature of the epidemic. WHO is evaluating ongoing research on the modes of spread of COVID-19 and will continue to share new findings. But because it is a risk, it is an additional reason to wash your hands regularly, after using the toilet and before eating."),"FAQAnswer8",Z.ax("While we are still learning how COVID-19 affects people, the elderly and people with pre-existing medical conditions (such as high blood pressure, heart disease, lung disease, cancer or diabetes) appear to develop serious illnesses more often than others."),"FAQAnswer9",Z.ax("No. Antibiotics are not effective against viruses, they only work on bacterial infections. COVID-19 is caused by a virus, so antibiotics don't work. Antibiotics should not be used to prevent or treat COVID-19. They should only be used as directed by a doctor to treat a bacterial infection."),"FAQQuestion1",Z.ax("What is a coronavirus ?"),"FAQQuestion10",Z.ax("Are antibiotics effective in preventing or treating COVID-19 ?"),"FAQQuestion2",Z.ax("What is COVID-19 ?"),"FAQQuestion3",Z.ax("What are the symptoms of COVID-19 ?"),"FAQQuestion4",Z.ax("How is COVID-19 spreading ?"),"FAQQuestion5",Z.ax("Can the virus that causes COVID-19 be airborne ?"),"FAQQuestion6",Z.ax("Can CoVID-19 be caught in a person who has no symptoms ?"),"FAQQuestion7",Z.ax("Can I get COVID-19 from the stool of someone with the disease ?"),"FAQQuestion9",Z.ax("What types of people are at risk of developing a serious illness ?"),"about",Z.ax("About"),"appDesc1",Z.ax("CORONED is basically a school project carried out to answer a practical work topic in a web development course given by CESI Dijon-Quetigny."),"appDesc2",Z.ax("We had the choice about the technology, so we formed a group to try to use Flutter for the web..."),"appDesc3",Z.ax("After a successful exam, the application evolves! \ud83d\ude80 We are happy to accept contributions ! \ud83d\udd25"),"appDesc4",Z.ax("Head over to github.com/rcdevril/cesi_covid_19_tracker !"),"appDesc5",Z.ax("You will find on this page the licenses associated with the software used for this Flutter project."),"contaminated",Z.ax("Contaminated"),"deaths",Z.ax("Deaths"),"globalStats",Z.ax("Global Statistics"),"recovered",Z.ax("Recovered"),"selectCountryDefaultText",Z.ax("Select a country")],u.X,u.y1)},
